import userActions from "../../_actions/user.actions";
import { Table, } from 'antd';
import { useDispatch, useSelector } from "react-redux";

const HomePage = () => {
    const dispatch= useDispatch()
    const authentication = useSelector(state => state.authentication)
    const {user} = useSelector(state => state.userReducers);
useEffect(() => {
dispatch(userActions.userList());
},[])
const columns = [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
    },
    {
      title: 'Gender',
      dataIndex: 'gender',
      key: 'gender',
    },
    {
      title: 'Email',
      dataIndex: 'email',
      key: 'email',
    },{
        title:"Username",
        dataIndex:"username",
        key:'username'
    },{
        title:"Password",
        dataIndex:"password",
        key:"password"
    },{
        title:"DOB",
        dataIndex:'dob',
        key:'dob'
    },{
        title:" Phone Number",
        dataIndex:"phoneNumber",
        key:"phoneNumber"
    }
  ];

  const userLists = user.map((details, index) => {
      return[
          {
              key: index,
              name: details.name.title+''+details.name.first+ ''+details.name.last,
              gender:details.gen
          }
      ]
  })
    return(
    <>
<h1 className='homepage-heading'>Hello {authentication.user.username}</h1>
{user && <Table columns={columns}/>}
    </>)
}

export default HomePage;
